David has $12.48 and wants to buy 16 bolts from a bin at the hardware store. Each bolt costs $0.03. How much money does David have left after paying for the bolts? This is a simple application of the subtraction operation. The key is to perform the subtraction to the nearest cent, rounding the answer to two decimal places.
\begin{tabular}{l l} David's money & = $12.48 \\ Cost of bolts & = $0.03 \(\times\) 16 \\  & = $0.48 \\ David's money after & = David's money - Cost of bolts \\ \end{tabular}
David's money after buying bolts = $12.48 - $0.48 = $12.00
\begin{tabular}{l l} David has $12.00 left after buying the 16 bolts. \\ \end{tabular}
## Rounding Numbers
Rounding numbers is a common mathematical operation. For example, rounding the number 3.8 to the nearest integer gives 4. The number 3.8 is said to be rounded up to 4. In contrast, rounding 3.7 to the nearest integer gives 3, which is said to be rounded down to 3. There are two standard rounding rules: the first is to round up to the nearest integer if the digit in the next decimal place is 5 or greater, and the second is to round down to the nearest integer if the digit in the next decimal place is 4 or less.
